import Button from '@material-ui/core/Button';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardHeader from '@material-ui/core/CardHeader';
import TextField from '@material-ui/core/TextField';
import { withStyles } from '@material-ui/core/styles';
// import { Link } from '@material-ui/core';
import Link from 'next/link';

const styles = theme => ({
    button: {
     margin:'10px'
    }

  });


function Login(){
    return(
        <Card className="Login">
          <CardHeader className="header" title="Login Page" titleTypographyProps="Login Page">

          </CardHeader>

          <CardContent className="cardContent">
            <TextField id="user_id" label="User Id" variant="outlined" color="primary" className="userid" style={{padding:9}} />
            <TextField type="password" id="password" label="Password" variant="outlined" color="primary" className="password"style={{padding:9}} />

              <div className="buttonClass">
                <Button variant="contained" color="primary"  type="submit" style={{padding:9}}><Link href={"/Profile"}><a>Login</a></Link></Button>
                <Button variant="contained" color="primary"  type="submit" style={{padding:9}}>Register</Button>
              </div>

              {/* <RoutingExample /> */}
          </CardContent>

        </Card>
    )
}

export default Login;
